data: {"type":"transcript.text.done","text":"Well, hello there, and welcome to Obstructive Lung Disease. In this chapter, we'll dive deep into two of the most common diseases internal medicine physicians see, asthma and COPD. Do those four letters sound familiar to you? If not, get used to it, because COPD will follow you throughout your career. Chronic Obstructive Pulmonary Disease, aka COPD, is an incredibly common condition characterized by airflow limitation. Why do we care about COPD? Well, for starters, it's one of the top five diseases that you'll see in the hospital and the clinic. It affects more than 5% of the population and is the third leading cause of death in the US. Sound important enough for you? Good, let's get started. Remember our crazy street hockey game from Sketchy Path? If you do, you're in luck. We'll be carrying that hockey theme over to Sketchy IM. This time, we're on ice. The Gold Cup Playoffs, in fact. If you don't, don't worry. We'll be covering the clinical presentation and management of COPD in this sketch. So make sure to check out our Sketchy Path sketch for all the pathophysiology details underlying COPD. COPD is defined as a common, preventable, and treatable disease characterized by persistent respiratory symptoms and airflow limitation due to airway and or alveolar abnormalities, usually caused by significant exposure to noxious particles or gases. There are two classic types of COPD, chronic bronchitis and emphysema. You've probably heard of your blue bloaters and pink puffers. That's what these two types of patients represent. It's important to remember that chronic bronchitis, your blue bloaters, is a clinical diagnosis requiring a chronic productive cough for three months per year for at least two consecutive years. Emphysema, your pink puffers, on the other hand, is a pathologic diagnosis requiring a lung biopsy sample showing permanent enlargement of airspaces distal to the terminal bronchioles due to destruction of alveolar walls. In reality, the two types often coexist, and it's rare to have pure emphysema or chronic bronchitis. As always, let's kick off our discussion of COPD by filling out our soap note, starting with the most common historical details you'll hear when you interview a typical patient. To know COPD is to know the three cardinal symptoms of COPD, dyspnea, cough, and sputum production, as represented by our two hockey players here. Yuck. That big goalie for the blue bloaters looks like he just coughed up a bunch of nasty green gunk. The classic COPD patient presenting with respiratory symptoms will generally complain about dyspnea and chronic cough. Initially, dyspnea will only occur with exertion, just like this tired hockey player for the pink puffers, but eventually it occurs with progressively less exertion or even at rest. Since the most common symptom of early COPD is dyspnea on exertion, many patients develop sedentary lifestyles and avoid exertion as a subconscious way to minimize their symptoms. COPD exacerbations present with acute worsening of one or more of these cardinal symptoms. Check out our next sketch if your patient is coming in with an acute COPD exacerbation. The most important risk factor for COPD is smoking, so it's super important to get a detailed smoking history from your patient. The most important piece of smoking history is the total amount smoked, standardized as a pack year. As a reminder, pack years equals packs per day times years smoked. With enough smoking, almost all smokers will develop measurably reduced lung function. The single best predictor for airflow obstruction on spirometry is more than 40 pack years of smoking. As you can see by the number 40 jersey worn by that smoking fan. Pretty sure you can't do that in here, guy. If you don't get a significant smoking history from your patient, and you believe him, be sure to ask about environmental exposures. Industrial fumes, dust, and secondhand smoke, like this poor fan suffering next to that chain smoker, help to explain the 20% of COPD patients who have never smoked. Finally, don't forget about alpha-1 antitrypsin deficiency. It's a common cause of COPD, especially in patients who present at an abnormally early age. At Sketchy, our recurring symbol for alpha-1 antitrypsin are those giant AAT shears, being manned by a very young kid working for the AA trimming family business. Patients may not be aware of the name alpha-1 antitrypsin deficiency, so ask if liver or lung disease runs in the family. Let's move on and talk about the objective findings that you'll see in your COPD patients. Early in the disease, the physical exam may be normal. If patients do have abnormal findings, the most common sign of early COPD is prolonged expiration, represented by this fan's extra-long party blower. As a refresher, normal expiration takes about twice as long as inspiration, an inspiration-expiration ratio of 1 to 2. Prolonged expiration is anything longer than an IE ratio of 1 to 2. As airway obstruction worsens, the physical exam will start to reflect hyperinflation and air trapping, including increased resonance to percussion, expiratory wheezing, and a wider barrel-shaped chest with increased anteroposterior diameter. Look, that cheering fan is percussing a pair of highly resonant barrel-shaped bongo drums. Someone's hyper-excited about this game. Finally, patients with end-stage COPD have to compensate for their severely impaired breathing. They adopt positions that relieve dyspnea, like leaning forward with their arms outstretched in the classic tripod posture. At Sketchy, tripodding is represented by a tripod, just like the one that referee is using to watch that replay. They also use accessory respiratory muscles to breathe, represented by those muscly straps holding up the referee's chest plate, and exhale through pursed lips, just like those pink puffers you've read so much about. Because of all that extra effort needed to move air, patients with end-stage COPD develop pulmonary cachexia and are often super thin. That's why you never really see an obese patient with severe COPD. They're too busy burning all their calories just to breathe. On top of all that, severe COPD is the most common cause of corpulmonale, aka right heart failure secondary to pulmonary hypertension. Remember our recurring sketchy symbol for corpulmonale, the corked heart bottle? Be sure to look for the classic findings of right heart failure if you suspect corpulmonale. Elevated jugular venous pressure, pitting edema in the legs, and hepatomegaly. We'll talk about corpulmonale in greater detail in our pulmonary hypertension sketch, so make sure to check it out. Before we move on to the assessment and plan, let's talk about the one big test that we use to diagnose COPD, spirometry. Pulmonary function testing, spirometry in particular, is the gold standard for diagnosing COPD and monitoring disease progression. That's why we've made this ice resurfacer look like a giant spirometer. If you remember only one thing from this sketch, make it this. Diagnosis of COPD is defined by an FEV1-FVC ratio less than 0.7 on spirometry. In addition, the flow volume loop will show expiratory scooping and increased lung volumes as a result of expiratory airflow limitation, making that classic shape reminiscent of that mound of ice left by the ice shoveler. These findings are all typical of any obstructive lung disease. Make sure to check out our PFTs how-to sketch for all the details you need to know about spirometry. To differentiate COPD from that other major obstructive lung disease, asthma, all you have to do is give some albuterol. Diagnosis of COPD requires irreversible or only partially reversible airflow limitation. Hence the broken reverse light sign on the ice resurfacer. If albuterol fully normalizes spirometry results, your patient more likely has asthma, since asthma is due to reversible bronchospasm without underlying lung tissue destruction. As airflow limitation increases, more air is trapped during expiration, reducing expiratory reserve volume and by extension vital capacity, and increasing residual volume and total lung capacity. Check it out. Those buckets for RV and TLC are chock full of ice. While that sign for visitor capacity is broken and falling down. For a refresher on lung volumes and capacities, check out our PFT how-to sketch. One unique laboratory test to consider ordering in certain patients is the alpha-1 antitrypsin level. Remember, alpha-1 antitrypsin deficiency is a rare cause of emphysematous COPD, so only get it if the presentation is unusual, such as patients who present with symptoms before age 45 and those with comorbid liver disease. These patients will also have red flags, like a family history of emphysema or liver disease and a lack of significant smoking history. Other than alpha-1 antitrypsin, routine laboratory testing should only be done to rule out alternative causes of chronic dyspnea, such as a hemoglobin level to evaluate for anemia or a BNP to assess for heart failure. So imaging isn't used to diagnose COPD? Yep, that's pretty much the case. That's because chest x-rays are often normal in patients with mild to moderate COPD. Classic findings such as hyperinflation and diaphragmatic flattening are only seen in severe disease. The main reason to get a chest x-ray when evaluating a patient for COPD is to rule out alternative diagnoses on the differential for chronic dyspnea, such as heart failure, lung cancer, and bronchiectasis. For the full differential for a patient presenting with chronic dyspnea, check out our dedicated chronic dyspnea DDX sketch. All right, let's sum up the classic subjective and objective findings of COPD in a clear, concise assessment. The Marlboro Man is a 62-year-old male with a 45-pack-year smoking history who presents with a productive cough and dyspnea on exertion for the","usage":{"type":"tokens","total_tokens":13045,"input_tokens"